import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport to ensure the mobile menu is visible
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // 1. Open the mobile menu by clicking the "All" button
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // 2. Wait for the mobile menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // 3. Click on the "Electronics" link inside the mobile menu
    const electronicsLink = mobileMenuOverlay.locator('a:has-text("Electronics")').first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // 4. Verify navigation to the Electronics category by checking for the header
    // The JS on the page updates the content without a full page load.
    const categoryHeader = page.locator('h2:has-text("Electronics")');
    await categoryHeader.waitFor({ state: 'visible', timeout: 5000 });
    const extractedData = {
      categoryTitle: await categoryHeader.textContent()
    };
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category_view.png'));

    // 5. Close the mobile menu
    const closeButton = mobileMenuOverlay.locator('button.close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // 6. Verify the mobile menu is hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Successfully opened, navigated, and closed the mobile menu.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
